import React from "react";
import {NavLink} from "react-router-dom";
import '../Elements/Button/button.scss'

// import {Link} from 'react-scroll'

const Menu = () => {

  return (
    <div className="o-row">
    <div className="o-col  t-site-header__menu">
      <ul className="c-nav">
          <li className="c-nav__item"><NavLink exact to="/">Start</NavLink></li>
          <li className="c-nav__item">O co chodzi</li>
          <li className="c-nav__item">O nas</li>
          <li className="c-nav__item">Fundacje i  organizacje</li>
          <li className="c-nav__item">Kontakt</li>
      </ul>
    </div>
    </div>
  )
}

export default Menu;
